import React from 'react';
import { useNavigate } from 'react-router-dom';

const Home = () => {
  const navigate = useNavigate();

  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-gray-100 p-6">
      <h1 className="text-4xl font-bold text-gray-800 mb-4">Welcome to Our Company</h1>
      <p className="text-lg text-gray-600 text-center mb-6">
        We provide the best services in web and app development, IT support, and more.
        Join us to elevate your business to the next level.
      </p>
      <img
        src="https://via.placeholder.com/600x400" // Replace with your image URL
        alt="Company"
        className="w-full max-w-md mb-6 rounded shadow-md"
      />
      <button
        className="bg-blue-500 hover:bg-blue-600 text-white py-2 px-4 rounded"
        onClick={() => navigate('/')}
      >
        Get Started
      </button>
    </div>
  );
};

export default Home;
